INSERT INTO `companies` VALUES (1,'PT Inovasi Teknologi Indonesia','Perusahaan teknologi terkemuka yang mengkhususkan diri dalam solusi inovatif untuk menghadapi tantangan digital masa kini. Kami memiliki keahlian dalam pengembangan aplikasi, keamanan siber, dan transformasi digital bagi berbagai sektor usaha.',NULL,'https://inovasitech.co.id','Jl. Teknologi No. 123, Jakarta Selatan, DKI Jakarta','021-5551234','info@inovasitech.co.id','Teknologi Informasi',1,'2025-07-03 10:52:54','2025-07-03 10:52:54'),(2,'PT Grup Finansial Global','Perusahaan jasa keuangan terpercaya yang menyediakan solusi perbankan dan investasi inovatif dengan jaringan internasional. Kami melayani berbagai kebutuhan finansial mulai dari perbankan pribadi, perencanaan keuangan, hingga manajemen aset untuk korporasi dan individu.',NULL,'https://globalfinansial.co.id','Jl. Sudirman No. 456, Jakarta Pusat, DKI Jakarta','021-5559876','info@globalfinansial.co.id','Keuangan & Perbankan',1,'2025-07-03 10:52:54','2025-07-03 10:52:54'),(3,'PT Kreasi Desain Indonesia','Agensi kreatif yang mengkhususkan diri dalam desain grafis, brand identity, dan strategi pemasaran visual. Kami menggabungkan kreativitas dengan pemahaman yang mendalam tentang prinsip-prinsip desain untuk menciptakan solusi visual yang menarik dan efektif bagi berbagai klien dari beragam industri.',NULL,'https://kreasidesain.co.id','Jl. Kreatif No. 789, Bandung, Jawa Barat','022-5554567','info@kreasidesain.co.id','Media & Hiburan',1,'2025-07-03 10:52:54','2025-07-03 10:52:54'),(4,'PT Medika Sentosa','Jaringan pelayanan kesehatan terpadu yang berfokus pada kualitas layanan dan keselamatan pasien dengan fasilitas modern. Kami memiliki jaringan rumah sakit, klinik spesialis, dan pusat kesehatan dengan tenaga medis profesional dan peralatan diagnostik terkini.',NULL,'https://medikasentosa.co.id','Jl. Kesehatan No. 101, Jakarta Timur, DKI Jakarta','021-5557890','info@medikasentosa.co.id','Kesehatan',1,'2025-07-03 10:52:54','2025-07-03 10:52:54'),(5,'PT Maju Jaya Konstruksi','Perusahaan konstruksi terpercaya dengan pengalaman luas dalam proyek-proyek infrastruktur, gedung komersial, dan perumahan. Kami menggabungkan keahlian teknik sipil, manajemen proyek yang efisien, dan komitmen terhadap keselamatan kerja untuk memberikan hasil konstruksi berkualitas tinggi.',NULL,'https://majujayakonstruksi.co.id','Jl. Pembangun No. 234, Surabaya, Jawa Timur','031-5556789','info@majujayakonstruksi.co.id','Konstruksi',1,'2025-07-03 10:52:54','2025-07-03 10:52:54'),(6,'PT Agro Nusantara','Perusahaan agrikultur terdepan yang mengelola perkebunan dan pengolahan hasil pertanian dengan fokus pada kesinambungan dan teknologi pertanian modern. Kami mengintegrasikan praktik pertanian berkelanjutan dengan inovasi teknologi untuk menghasilkan produk-produk berkualitas tinggi yang ramah lingkungan.',NULL,'https://agronusantara.co.id','Jl. Pertanian No. 567, Medan, Sumatera Utara','061-5558765','info@agronusantara.co.id','Agrikultur',1,'2025-07-03 10:52:54','2025-07-03 10:52:54'),(7,'PT Retail Maju Indonesia','Jaringan retail modern dengan ragam produk lengkap dan pengalaman belanja nyaman di berbagai kota besar Indonesia. Kami menawarkan berbagai pilihan produk mulai dari kebutuhan sehari-hari, elektronik, fashion, hingga perabotan rumah tangga dengan pelayanan pelanggan yang ramah dan profesional.',NULL,'https://retailmaju.co.id','Jl. Shopping No. 890, Tangerang, Banten','021-5552345','info@retailmaju.co.id','Retail',1,'2025-07-03 10:52:54','2025-07-03 10:52:54'),(8,'PT Edu Cendekia','Lembaga pendidikan dengan kurikulum komprehensif dan metode pembelajaran inovatif untuk mengembangkan potensi optimal siswa. Kami memadukan pendidikan karakter, pengembangan keterampilan abad ke-21, dan keunggulan akademik untuk mempersiapkan peserta didik menghadapi tantangan global.',NULL,'https://educendekia.co.id','Jl. Pendidikan No. 432, Yogyakarta, DI Yogyakarta','0274-5556543','info@educendekia.co.id','Pendidikan',1,'2025-07-03 10:52:54','2025-07-03 10:52:54'),(9,'PT Logistik Cepat Indonesia','Penyedia jasa logistik dan pengiriman dengan jaringan distribusi luas yang menjangkau seluruh wilayah Indonesia. Kami menawarkan layanan pengiriman yang cepat, aman, dan dapat dilacak dengan sistem manajemen logistik terintegrasi yang didukung teknologi terkini.',NULL,'https://logistikcepat.co.id','Jl. Distribusi No. 321, Makassar, Sulawesi Selatan','0411-5554321','info@logistikcepat.co.id','Transportasi & Logistik',1,'2025-07-03 10:52:54','2025-07-03 10:52:54'),(10,'PT Digital Solusi Indonesia','Perusahaan solusi digital yang menyediakan layanan pengembangan perangkat lunak, konsultasi IT, dan transformasi digital bagi korporasi dan UMKM. Kami membantu organisasi memanfaatkan kekuatan teknologi digital untuk meningkatkan efisiensi operasional, memperluas jangkauan pasar, dan meningkatkan pengalaman pelanggan.',NULL,'https://digitalsolusi.co.id','Jl. Digital No. 789, Jakarta Barat, DKI Jakarta','021-5553456','info@digitalsolusi.co.id','Teknologi Informasi',1,'2025-07-03 10:52:54','2025-07-03 10:52:54'),(11,'Maju CV Susanti (Persero) Tbk','Veritatis aliquid est repellendus fugit aut. Temporibus nesciunt dolorum minima explicabo odio eum quisquam. Beatae magni corrupti eius repudiandae veniam quo. Alias dolor sint voluptas iure. Quia quibusdam consequatur et et non aliquam. Aut dignissimos voluptatum quisquam impedit non numquam eos.',NULL,'https://www.cvsusantiperserotbk.co.id','Dk. Baha No. 708, Balikpapan, Jawa Tengah','(+62) 677 8449 9656','info@cvsusantiperserotbk.co.id','Keuangan & Perbankan',1,'2025-07-03 10:52:54','2025-07-03 10:52:54'),(12,'PD Yayasan Tarihoran Suryatmi Tbk','Magnam ipsum culpa reiciendis et nisi quo et. Voluptatum iste autem non qui. Et distinctio blanditiis autem harum ut quae. Voluptatibus nulla aut minus debitis tenetur. Sit soluta doloribus ut ipsum et ducimus.',NULL,'https://www.yayasantarihoransuryatmitbk.co.id','Gg. Tangkuban Perahu No. 550, Bandung Timur, Lampung','(+62) 327 2244 57