INSERT INTO `forum_posts` VALUES (1,'<p>Halo teman-teman! Saya ingin berbagi informasi tentang program magang di Google Indonesia. Ada beberapa posisi yang dibuka:</p>\n                    <ul>\n                        <li>Software Engineering Intern</li>\n                        <li>UX Design Intern</li>\n                        <li>Marketing Intern</li>\n                        <li>Business Development Intern</li>\n                    </ul>\n                    <p>Persyaratan umum:</p>\n                    <ul>\n                        <li>Mahasiswa aktif/fresh graduate (maksimal 1 tahun)</li>\n                        <li>IPK minimal 3.5</li>\n                        <li>Menguasai bahasa Inggris</li>\n                    </ul>\n                    <p>Untuk posisi Software Engineering, diutamakan yang menguasai Java, Python, atau Go.</p>\n                    <p>Pendaftaran dibuka mulai 15 Januari hingga 28 Februari 2025. Silakan kunjungi careers.google.com untuk informasi lebih lanjut.</p>',1,1,5,0,'2025-07-03 10:53:02','2025-07-03 10:53:02',NULL),(2,'<p>Terima kasih infonya! Apakah ada yang sudah pernah magang di Google Indonesia sebelumnya? Saya ingin tahu bagaimana pengalaman dan proses seleksinya.</p>',0,1,5,0,'2025-07-03 10:53:02','2025-07-03 10:53:02',NULL),(3,'<p>Saya pernah mengikuti proses seleksi tahun lalu meskipun tidak lolos sampai akhir. Prosesnya cukup panjang:</p>\n                    <ol>\n                        <li>Seleksi CV dan cover letter</li>\n                        <li>Online assessment (coding test untuk engineer, design challenge untuk desainer)</li>\n                        <li>Initial interview dengan HR</li>\n                        <li>Technical interview (1-2 putaran)</li>\n                        <li>Final interview</li>\n                    </ol>\n                    <p>Tips dari saya: persiapkan portfolio yang baik, latih problem solving, dan pelajari tentang budaya Google. Good luck!</p>',0,1,8,0,'2025-07-03 10:53:02','2025-07-0