aya sudah menyiapkan template yang bisa digunakan. Silakan download dari link berikut: <a href=\'#\'>Download Template CV</a></p>\n                    <p>Semoga bermanfaat!</p>',1,6,7,0,'2025-07-03 10:53:02','2025-07-03 10:53:02',NULL),(21,'<p>Terima kasih templatenya! Kalau boleh tahu, kata kunci apa saja yang sebaiknya dimasukkan untuk posisi di bidang IT?</p>',0,6,7,0,'2025-07-03 10:53:02','2025-07-03 10:53:02',NULL),(22,'<p>Untuk bidang IT, beberapa kata kunci yang sering dicari:</p>\n                    <ul>\n                        <li>Bahasa pemrograman: Java, Python, JavaScript, PHP, C++, dll</li>\n                        <li>Framework: React, Angular, Vue, Laravel, Django, Spring, dll</li>\n                        <li>Database: MySQL, PostgreSQL, MongoDB, Oracle</li>\n                        <li>Tools: Git, Docker, Kubernetes, Jenkins</li>\n                        <li>Soft skills: Problem solving, teamwork, communication</li>\n                    </ul>\n                    <p>Pastikan hanya mencantumkan skill yang benar-benar dikuasai, karena biasanya akan ditanyakan saat interview.</p>',0,6,5,0,'2025-07-03 10:53:02','2025-07-03 10:53:02',NULL),(23,'<p>Vel voluptatem rerum dicta quam et. Ullam eveniet consequatur qui nihil. Quam est deserunt numquam iure. Perspiciatis sit soluta sequi reprehenderit. Ipsa sunt quo unde. Consectetur earum ut cum eum. Eaque est quam natus ut aspernatur ducimus aut. Beatae qui repudiandae sit rerum voluptatem beatae.</p><p>Quia error eius ut. Explicabo ea perspiciatis sed impedit minus voluptatem nulla. Aperiam quasi non eos. Necessitatibus consequatur nostrum aut laborum soluta necessitatibus.</p><p>Consequatur sit velit tenetur ea placeat aperiam ab. Aut eius aut et molestiae. Illo et totam a qui. Voluptas est nihil illo laborum fugit.</p>',1,7,5,0,'2025-07-03 10:53:02','2025-07-03 10:53:02',NULL),(24,'<p>Voluptatem nesciunt id sunt eligendi dolor dolorem id. Voluptatem et error ipsum rem assumenda. Aut numquam tenetur simili