INSERT INTO `jobs` VALUES (1,'Software Engineer','Kami mencari Software Engineer yang terampil untuk bergabung dengan tim pengembangan kami.','- Gelar Sarjana di bidang Ilmu Komputer atau bidang terkait\n- Pengalaman 2+ tahun dalam pengembangan web\n- Kemampuan dalam PHP, Laravel, JavaScript\n- Pengalaman dengan framework front-end seperti React atau Vue.js\n- Keterampilan dalam memecahkan masalah','- Mengembangkan dan memelihara aplikasi web\n- Menulis kode yang bersih, efisien, dan terdokumentasi dengan baik\n- Berkolaborasi dengan tim lintas fungsi\n- Berpartisipasi dalam review kode\n- Memecahkan masalah dan melakukan debugging aplikasi','- Gaji yang kompetitif\n- Asuransi kesehatan\n- Jam kerja fleksibel\n- Kesempatan pengembangan profesional\n- Lingkungan kantor yang modern',NULL,1,NULL,'Jakarta','Full-time','2-4 tahun',8000000.00,15000000.00,1,2,'2025-07-29',NULL,1,'draft','2025-07-03 10:52:55','2025-07-03 10:52:55'),(2,'UI/UX Designer','Kami mencari UI/UX Designer kreatif untuk menciptakan pengalaman pengguna yang luar biasa.','- Gelar Sarjana di bidang Desain, HCI, atau bidang terkait\n- Pengalaman 3+ tahun dalam desain UI/UX\n- Kemampuan dalam alat desain seperti Figma, Sketch, Adobe XD\n- Portofolio yang menunjukkan keterampilan desain\n- Pemahaman tentang prinsip desain yang berfokus pada pengguna','- Membuat desain yang berfokus pada pengguna\n- Mengembangkan wireframe, prototipe, dan alur pengguna\n- Melakukan riset dan pengujian pengguna\n- Berkolaborasi dengan pengembang dan manajer produk\n- Tetap terupdate dengan tren desain terbaru','- Gaji yang kompetitif\n- Asuransi kesehatan\n- Jam kerja fleksibel\n- Lingkungan kerja yang kreatif\n- Anggaran untuk pengembangan profesional',NULL,1,NULL,'Bandung','Full-time','3-5 tahun',9000000.00,16000000.00,1,1,'2025-07-25',NULL,1,'draft','2025-07-03 10:52:55','2025-07-03 10:52:55'),(3,'Data Analyst','Bergabunglah dengan tim analitik kami sebagai Data Analyst untuk membantu kami membuat keputusan berbasis data.','- Gelar Sarjana di bidang Statistik, Matematika, atau bidang terkait\n- Pengalaman 1+ tahun dalam analisis data\n- Kemampuan dalam SQL, Excel, dan alat visualisasi data\n- Pengalaman dengan Python atau R\n- Keterampilan analitis dan pemecahan masalah yang kuat','- Menganalisis data dan mengidentifikasi tren\n- Membuat dan memelihara dashboard\n- Menghasilkan laporan dan wawasan\n- Mendukung keputusan bisnis dengan data\n- Berkolaborasi dengan tim lintas fungsi','- Gaji yang kompetitif\n- Asuransi kesehatan dan gigi\n- Tunjangan hari raya\n- Kesempatan untuk terus belajar\n- Jadwal kerja fleksibel',NULL,1,NULL,'Surabaya','Full-time','1-3 tahun',7000000.00,12000000.00,0,1,'2025-07-28',NULL,1,'draft','2025-07-03 10:52:55','2025-07-03 10:52:55'),(4,'Marketing Manager','Pimpin upaya pemasaran kami untuk meningkatkan kesadaran merek dan akuisisi pelanggan.','- Gelar Sarjana di bidang Pemasaran, Bisnis, atau bidang terkait\n- Pengalaman 5+ tahun dalam pemasaran\n- Pengalaman dengan saluran pemasaran digital\n- Keterampilan manajemen proyek yang kuat\n- Komunikasi tertulis dan lisan yang sangat baik','- Mengembangkan dan menerapkan strategi pemasaran\n- Mengelola kampanye pemasaran dan anggaran\n- Menganalisis kinerja kampanye\n- Memimpin tim profesional pemasaran\n- Berkolaborasi dengan tim penjualan dan produk','- Gaji yang kompetitif\n- Paket tunjangan komprehensif\n- Bonus kinerja\n- Pengembangan profesional\n- Pengaturan kerja yang fleksibel',NULL,1,NULL,'Yogyakarta','Full-time','5-7 tahun',15000000.00,25000000.00,1,1,'2025-08-01',NULL,1,'draft','2025-07-03 10:52:55','2025-07-03 10:52:55'),(5,'Customer Support Specialist','Bergabunglah dengan tim dukungan pelanggan kami untuk memberikan layanan terbaik kepada pelanggan kami.','- Ijazah SMA atau setara\n- Pengalaman 1+ tahun dalam layanan pelanggan\n- Keterampilan komunikasi yang sangat baik\n- Kemampuan memecahkan masalah\n- Kesabaran dan empati','- Menanggapi pertanyaan pelanggan melalui email, telepon, dan chat\n- Memecahkan masalah dan memberikan solusi\n- Meningkatkan masalah kompleks kepada tim terkait\n- Mempertahankan kepuasan pelanggan\n- Mencatat interaksi pelanggan','- Gaji yang kompetitif\n- Asuransi kesehatan\n- Cuti berbayar\n- Diskon karyawan\n- Pengembangan profesional',NULL,1,NULL,'Bali','Part-time','0-2 tahun',3000000.00,5000000.00,0,3,'2025-08-01',NULL,1,'draft','2025-07-03 10:52:55','2025-07-03 10:52:55'),(6,'Backend Developer','Bergabunglah dengan tim pengembangan kami sebagai Backend Developer untuk membantu kami membangun sistem server yang kuat.','- Gelar Sarjana di bidang Ilmu Komputer atau bidang terkait\n- Pengalaman 3+ tahun dalam pengembangan backend\n- Keahlian dalam Node.js, Python, atau Ruby\n- Pemahaman yang kuat tentang basis data (SQL dan NoSQL)\n- Pengalaman dengan platform cloud seperti AWS atau Azure','- Mengembangkan logika server-side dan API\n- Memelihara dan mengoptimalkan infrastruktur backend\n- Berkolaborasi dengan pengembang frontend\n- Memecahkan masalah dan debugging masalah server\n- Menulis kode yang bersih dan dapat diskalakan','- Gaji yang kompetitif\n- Asuransi kesehatan\n- Cuti berbayar\n- Opsi kerja remote\n- Kesempatan untuk berkembang dalam karier',NULL,1,NULL,'Jakarta','Full-time','3-5 tahun',10000000.00,18000000.00,1,2,'2025-08-01',NULL,1,'draft','2025-07-03 10:52:55','2025-07-03 10:52:55'),(7,'Manajer SDM','Pimpin departemen SDM dan kelola semua aspek hubungan karyawan.','- Gelar Sarjana di bidang Sumber Daya Manusia atau bidang terkait\n- Pengalaman 5+ tahun dalam sumber daya manusia\n- Pengetahuan yang kuat tentang hukum ketenagakerjaan dan kebijakan HR\n- Keterampilan kepemimpinan dan komunikasi yang sangat baik\n- Kemampuan untuk menyelesaikan konflik dan mengelola hubungan karyawan','- Mengawasi rekrutmen dan pengisian posisi\n- Mengelola hubungan karyawan dan menyelesaikan konflik\n- Mengembangkan dan menerapkan kebijakan HR\n- Memantau dan memastikan kepatuhan terhadap hukum ketenagakerjaan\n- Memimpin inisiatif HR dan program pelatihan','- Gaji yang kompetitif\n- Asuransi kesehatan\n- Bonus kinerja\n- Keseimbangan kerja-hidup\n- Kesempatan pengembangan profesional',NULL,1,NULL,'Medan','Full-time','5-7 tahun',15000000.00,25000000.00,1,1,'2025-07-31',NULL,1,'draft','2025-07-03 10:52:55','2025-07-03 10:52:55'),(8,'Manajer Proyek','Pimpin tim proyek untuk memastikan keberhasilan pengiriman proyek.','- Gelar Sarjana di bidang Bisnis, Teknik, atau bidang terkait\n- Pengalaman 4+ tahun dalam manajemen proyek\n- Keterampilan kepemimpinan dan komunikasi yang kuat\n- Kemahiran dalam alat manajemen proyek\n- Kemampuan untuk mengelola beberapa proyek secara bersamaan','- Mengembangkan rencana dan jadwal proyek\n- Memimpin tim proyek dan menetapkan tugas\n- Memastikan tenggat waktu proyek terpenuhi\n- Berkomunikasi dengan pemangku kepentingan dan melaporkan kemajuan\n- Menyelesaikan masalah dan risiko proyek','- Gaji yang kompetitif\n- Asuransi kesehatan dan gigi\n- Program pensiun\n- Keseimbangan kerja-hidup\n- Kesempatan pengembangan kepemimpinan',NULL,1,NULL,'Surabaya','Full-time','4-6 tahun',12000000.00,20000000.00,1,1,'2025-07-26',NULL,1,'draft','2025-07-03 10:52:55','2025-07-03 10:52:55'),(9,'Frontend Developer','Kami mencari Frontend Developer untuk membangun antarmuka pengguna yang menarik dan responsif.','- Gelar Sarjana di bidang Ilmu Komputer atau setara\n- Pengalaman 2+ tahun dalam pengembangan frontend\n- Keahlian dalam HTML, CSS, dan JavaScript\n- Pengalaman dengan React, Vue.js, atau Angular\n- Pemahaman tentang desain responsif dan kompatibilitas lintas browser','- Mengembangkan antarmuka pengguna yang menarik dan responsif\n- Mengimplementasikan desain UI/UX ke dalam kode\n- Mengoptimalkan aplikasi untuk kecepatan dan skalabilitas\n- Berkolaborasi dengan desainer dan pengembang backend\n- Memastikan kualitas kode dan praktik terbaik','- Gaji kompetitif\n- Asuransi kesehatan\n- Tunjangan transportasi\n- Lingkungan kerja yang dinamis\n- Program pengembangan karir',NULL,1,NULL,'Jakarta','Full-time','2-4 tahun',8000000.00,15000000.00,1,2,'2025-07-21',NULL,1,'draft','2025-07-03 10:52:55','2025-07-03 10:52:55'),(10,'Content Writer','Kami mencari Content Writer kreatif untuk menghasilkan konten yang menarik dan informatif untuk berbagai platform.','- Gelar Sarjana di bidang Jurnalisme, Komunikasi, atau setara\n- Pengalaman 1+ tahun dalam penulisan konten\n- Kemampuan menulis yang sangat baik dalam Bahasa Indonesia dan Inggris\n- Pemahaman tentang SEO dan tren konten digital\n- Kreativitas dan kemampuan untuk menyampaikan ide dengan jelas','- Membuat konten berkualitas tinggi untuk website, blog, dan media sosial\n- Melakukan riset dan menulis tentang berbagai topik\n- Mengedit dan memperbaiki konten yang ada\n- Mengoptimalkan konten untuk SEO\n- Berkolaborasi dengan tim pemasaran dan desain','- Gaji yang kompetitif\n- Tunjangan kesehatan\n- Jam kerja fleksibel\n- Lingkungan kerja yang kreatif\n- Kesempatan untuk berkembang',NULL,1,NULL,'Yogyakarta','Full-time','1-3 tahun',5000000.00,8000000.00,1,1,'2025-07-30',NULL,1,'draft','2025-07-03 10:52:55','2025-07-03 10:52:55'),(11,'Digital Marketing Specialist','Bergabunglah dengan tim pemasaran kami untuk mengelola kampanye digital dan meningkatkan kehadiran online kami.','- Gelar Sarjana di bidang Pemasaran atau terkait\n- Pengalaman 2+ tahun dalam pemasaran digital\n- Pemahaman mendalam tentang media sosial, SEO, dan SEM\n- Pengalaman dengan Google Analytics dan alat pemasaran digital lainnya\n- Keterampilan analitis dan kreativitas yang tinggi','- Mengelola kampanye pemasaran digital\n- Mengoptimalkan strategi SEO dan SEM\n- Mengelola akun media sosial perusahaan\n- Menganalisis kinerja kampanye dan menyajikan laporan\n- Mengidentifikasi dan menerapkan tren pemasaran terbaru','- Gaji kompetitif\n- Paket tunjangan lengkap\n- Lingkungan kerja yang dinamis\n- Pelatihan dan pengembangan berkelanjutan\n- Kesempatan networking',NULL,2,NULL,'Jakarta','Full-time','2-4 tahun',8000000.00,15000000.00,0,1,'2025-07-30',NULL,1,'draft','2025-07-03 10:52:55','2025-07-03 10:52:55'),(12,'Graphic Designer','Kami mencari Graphic Designer berbakat untuk membuat desain visual yang menarik untuk berbagai platform.','- Gelar di bidang Desain Grafis atau setara\n- Pengalaman 2+ tahun dalam desain grafis\n- Kemahiran dalam Adobe Creative Suite (Photoshop, Illustrator, InDesign)\n- Portofolio desain yang mengesankan\n- Pemahaman yang baik tentang tren desain terkini','- Membuat aset visual untuk platform digital dan cetak\n- Merancang materi pemasaran, termasuk brosur, banner, dan media sosial\n- Memastikan konsistensi identitas merek\n- Berkolaborasi dengan tim pemasaran dan produk\n- Mengoptimalkan aset desain untuk berbagai platform','- Gaji yang kompetitif\n- Asuransi kesehatan\n- Lingkungan kerja kreatif\n- Jam kerja fleksibel\n- Pengembangan profesional',NULL,2,NULL,'Bandung','Full-time','2-4 tahun',6000000.00,12000000.00,1,1,'2025-07-26',NULL,1,'draft','2025-07-03 10:52:55','2025-07-03 10:52:55'),(13,'Quality Assurance Engineer','Kami mencari QA Engineer teliti untuk memastikan kualitas tinggi dari produk software kami.','- Gelar di bidang Ilmu Komputer atau setara\n- Pengalaman 2+ tahun dalam pengujian software\n- Pengetahuan tentang metodologi dan alat pengujian\n- Kemampuan mengidentifikasi dan mendokumentasikan bug\n- Pemahaman tentang siklus pengembangan software','- Merancang dan mengeksekusi kasus uji\n- Melakukan pengujian fungsional dan regresi\n- Melaporkan dan melacak bug\n- Berkolaborasi dengan tim pengembangan untuk menyelesaikan masalah\n- Memastikan kualitas produk sebelum rilis','- Gaji yang kompetitif\n- Asuransi kesehatan\n- Tunjangan makan dan transportasi\n- Lingkungan kerja yang kolaboratif\n- Kesempatan pengembangan karir',NULL,2,NULL,'Jakarta','Full-time','2-4 tahun',7000000.00,13000000.00,1,2,'2025-08-02',NULL,1,'draft','2025-07-03 10:52:55','2025-07-03 10:52:55'),(14,'Business Analyst','Kami mencari Business Analyst untuk menjembatani kesenjangan antara bisnis dan TI.','- Gelar di bidang Bisnis, Teknologi, atau setara\n- Pengalaman 3+ tahun sebagai analis bisnis\n- Keterampilan analitis dan pemecahan masalah yang kuat\n- Pemahaman tentang proses bisnis dan sistem TI\n- Keterampilan komunikasi yang sangat baik','- Mengidentifikasi dan menilai kebutuhan bisnis\n- Mendokumentasikan proses dan persyaratan\n- Menganalisis data untuk mendukung keputusan bisnis\n- Berkolaborasi dengan pemangku kepentingan dan tim teknis\n- Memantau dan melaporkan metrik kinerja','- Gaji yang kompetitif\n- Asuransi kesehatan komprehensif\n- Program bonus tahunan\n- Pengembangan profesional\n- Keseimbangan kerja-hidup',NULL,2,NULL,'Jakarta','Full-time','3-5 tahun',12000000.00,20000000.00,1,1,'2025-07-23',NULL,1,'draft','2025-07-03 10:52:55','2025-07-03 10:52:55'),(15,'DevOps Engineer','Bergabunglah dengan tim infrastruktur kami sebagai DevOps Engineer untuk mengelola dan mengoptimalkan pipeline CI/CD kami.','- Gelar di bidang Ilmu Komputer atau setara\n- Pengalaman 3+ tahun dalam praktik DevOps\n- Pengetahuan mendalam tentang Docker, Kubernetes, dan CI/CD\n- Pengalaman dengan AWS, Azure, atau GCP\n- Keterampilan scripting (Python, Bash)','- Mengelola dan mengotomatisasi infrastruktur\n- Mengimplementasikan dan mengelola pipeline CI/CD\n- Memantau dan mengoptimalkan kinerja sistem\n- Berkolaborasi dengan tim pengembangan untuk deployment\n- Memastikan keamanan dan keandalan sistem','- Gaji di atas rata-rata industri\n- Asuransi kesehatan komprehensif\n- Bonus kinerja\n- Kesempatan untuk bekerja dengan teknologi terbaru\n- Lingkungan kerja yang fleksibel',NULL,2,NULL,'Jakarta','Full-time','3-5 tahun',15000000.00,25000000.00,1,1,'2025-07-30',NULL,1,'draft','2025-07-03 10:52:55','2025-07-03 10:52:55'),(16,'Digital Marketing Specialist','Bergabunglah dengan tim pemasaran kami untuk mengelola kampanye digital dan meningkatkan kehadiran online kami.','- Gelar Sarjana di bidang Pemasaran atau terkait\n- Pengalaman 2+ tahun dalam pemasaran 